ISLAMABAD, Sept 07 (APP): Irfan Ullah Khan Marwat, a former member of Sindh Assembly and his daughter Samar Haroon Bilour, a former members of Khyber Pakhtunkhwa Assembly, on Thursday called on Caretaker Prime Minister Anwaar-ul-Haq Kakar.
They congratulated the prime minister on assuming his office and expressed their good wishes, PM Office Media Wing said in a press release.
